import BaseCarousel from './BaseCarousel';
import ProfileCard from './ProfileCard';

const ProfileCardsCarousel = (props) => {
    return (
        <BaseCarousel show={1}>
            <ProfileCard />
            <ProfileCard />
            <ProfileCard />
            <ProfileCard />
            <ProfileCard />
        </BaseCarousel>
    )
};

export default ProfileCardsCarousel;
